import React, { useContext, useState } from "react";
import { withStyles } from "@material-ui/core/styles";
import Button from "@material-ui/core/Button";
import { QuizTestStateContext } from "../Questions/Questions";
import Dialog from "./SubmitDialog/SubmitDialog";
import useSubmit from "./useSubmit";

export default function Submit() {
  const { open, handleOpen, handleClose } = useSubmit();

  return (
    <div>
      <br />
      <SubmitButton
        variant="outlined"
        fullWidth={true}
        onClick={handleOpen}
      >
        Submit
      </SubmitButton>
      <Dialog open={open} onClose={handleClose} handleSubmit={handleSubmit} />
    </div>
  );
}

const SubmitButton = withStyles({
  root: {
    color: "#0f3a86",
    border: "1px solid #0f3a86",
    marginBottom: "2rem",
    marginTop: "0.5rem",
  },
})(Button);
